// The result is an expert-based meta-analysis that uses semi-subjective (ranked) survey data to generate regional assessments of land use over time.They map the dating and extent of four 'agricultural' regimes across the world:1) Foraging: Foraging/hunting/gathering/fishing - subsistence based on hunting wild animals, gathering wild plants, and fishing, without deliberately modifying the reproduction of plants and animals that people exploit.2) Pastoralism: the exploitation of pasturelands for animal husbandry - including the breeding, care, and use of domesticated herd animals (e.g., sheep, goats, camels, cattle, horses, llamas, reindeer, and yaks).3) Extensive agriculture: swidden/shifting cultivation and other forms of noncontinuous cultivation.4) Intensive agriculture: all other forms of continuous cultivation (including irrigated and nonirrigated annual cropping, tropical agroforestry, flooded field farming, and industrial monocrop/plantation agriculture).
