// Details on how this is constructed are available here: https://ourworldindata.org/population-sourcesArmed forces as a share of total population is then calculated by dividing total armed forces personnel by population and multiplying by 100.
// The input and output files, and script used to calculate this data is available on GitHub here: https://github.com/owid/notebooks/tree/main/HannahRitchie/armed-forces-----Armed forces personnel are active duty military personnel, including paramilitary forces if the training, organization, equipment, and control suggest they may be used to support or replace regular military forces.Limitations and exceptions: Data excludes personnel not on active duty, therefore it underestimates the share of the labor force working for the defense establishment.
