// Data is that of version 10 of Gapminder, the latest version as of 2019.
// This is the full child mortality rate dataset published by Gapminder.Gapminder's sources and methodology if well-documented in its dataset at: https://www.gapminder.org/data/It notes its data sources during three key periods of time:— 1800 to 1950: Gapminder v7  ( In some cases this is also used for years after 1950, see below.) This was compiled and documented by Mattias Lindgren from many sources, but mainly based on www.mortality.org and the series of books called International Historical Statistics  by Brian R Mitchell, which often have historic estimates of Infant mortality rate which were converted to Child mortality through regression.
// See detailed documentation of v7 below.— 1950 to 2016: UNIGME, is a data collaboration project between UNICEF, WHO, UN Population Division and the World Bank.
// They  released new estimates of child mortality for countries and a global estimate on October 17, 2017, which is available at www.childmortality.org.
// In this dataset almost all countries have estimates between 1970 and 2016, while roughly half the countries also reach back to 1950.— 1950 to 2100: UN WPP, World Population Prospects 2017  provides annual data for Child mortality rate for all countries in the interpolated demographic indicators, called WPP2017_INT_F01_ANNUAL_DEMOGRAPHIC_INDICATORS.xlsx, accessed on September 2, 2017.Version 12 of the dataset extends back to the year 1800.
// Version 6 of Gapminder's fertility series includes data for a few countries further than 1800.
// We have included more historic data from Version 6 for Finland, the United Kingdom and Sweden.
// All data from 1800 onwards is from Version 12; data from pre-1800 is from Version 6.There are significant uncertainties in data for many countries pre-1950.
// To develop full series back to 1800 for all countries, Gapminder combines published estimates within the academic literature and national statistics, with their own guesstimates and extrapolations for countries without published estimates.
// This series presents the full Gapminder dataset: both those from published estimates and estimates made by Gapminder with high uncertainty.
// This is provided so users have access to the full dataset.However, for our main long-term series on child mortality rates at Our World in Data we exclude the highly uncertain data points which are not backed up with published estimates within the literature.
