// The Global Hunger Index (GHI) is a tool designed to comprehensively measure and track hunger globally, regionally, and by country.
// To reflect the multidimensional nature of hunger, the GHI combines four component indicators into one index score.
// An increase in a country's GHI score indicates that the hunger situation is worsening, while a decrease in the score indicates an improvement in the hunger situation.The four indicators used to calculate the GHI are:- Undernourishment: the proportion of undernourished people as a percentage of the population;- Child wasting: the proportion of children under the age of five who suffer from wasting (low weight for their height, reflecting acute undernutrition);- Child stunting: the proportion of children under the age of five who suffer from stunting (low height for their age, reflecting chronic undernutrition); and- Child mortality: the mortality rate of children under the age of five (partially reflecting the fatal synergy of inadequate nutrition and unhealthy environments).The formula and weighting of these four indicators in relation to the final index score can be found at: https://www.globalhungerindex.org/pdf/en/2021.pdfThe 2021 GHI has been calculated for 135 countries for which data on the four component indicators are available and where measuring hunger is considered most relevant.
// GHI scores are not calculated for some higher-income countries where the prevalence of hunger is very low.Where original source data were unavailable, the GHI was estimated based on the most recent data available.
// For 19 countries, individual scores could not be calculated owing to lack of data.
// 12 of those countries (Burundi, Comoros, Guinea, Guinea-Bissau, Moldova, Niger, South Sudan, Syria, Tajikistan, Uganda, Zambia, and Zimbabwe) were provisionally designated by severity.
// In OWID's dataset, the GHI of these 12 countries corresponds to the mid-point of their group in the severity scale.
// For example, for the 'moderate' group, with GHI between 10 and 20, we assign 15.
type GlobalHungerIndex2021Dataset struct {
	GlobalHungerIndex2021 *float64 `json:"global_hunger_index_2021"`
}

