// Data denotes the global warming potential (GWP) over a 100-year timescale for greenhouse gases relative to the GWP of carbon dioxide (which is denoted as 1).
// Global warming potential measures the relative warming impact of one unit mass of gas relative to one unit of carbon dioxide.
// For example, a GWP value for gas 'x' of 25 would mean one tonne of 'x' would have 25 times the warming impact of one tonne of carbon dioixde.GWP100 values are used to convert greenhouse gases into a carbon dioxide equivalent (CO2e) metric by multiplying emissions in mass terms by their respective GWP100 factors.In the IPCC's 5th Assessment Report (AR5), it presents GWP both with and without climate change feedback effects.
// For some gases, for example methane, this can introduce significant uncertainty.
// In the case of methane, the GWP100 value without feedbacks is 28; with feedbacks this increases to 34.
// In its official figures the IPCC adopts GWP100 factors without climate change feedbacks.
// Here we present the same figures without climate change feedbacks to maintain consistency with the IPCC.
type GlobalWarmingPotentialFactorsGwp100Ipcc2014Dataset struct {
	Co2Ipcc2014     *float64 `json:"co2_ipcc_2014"`
	Ch4Ipcc2014     *float64 `json:"ch4_ipcc_2014"`
	N2oIpcc2014     *float64 `json:"n2o_ipcc_2014"`
	Cf4Ipcc2014     *float64 `json:"cf4_ipcc_2014"`
	Hfc152aIpcc2014 *float64 `json:"hfc_152a_ipcc_2014"`
	Sf6Ipcc2014     *float64 `json:"sf6_ipcc_2014"`
	Pfc14Ipcc2014   *float64 `json:"pfc_14_ipcc_2014"`
}

