// The following definitions are taken from World Bank's World Development Index description in 'Details'.
//
// Price level ratio of PPP conversion factor (GDP) to market exchange rate:
//
// "Purchasing power parity conversion factor is the number of units of a country's currency required to buy the same amount of goods and services in the domestic market as a U.S.
// dollar would buy in the United States.
// The ratio of PPP conversion factor to market exchange rate is the result obtained by dividing the PPP conversion factor by the market exchange rate.
// The ratio, also referred to as the national price level, makes it possible to compare the cost of the bundle of goods that make up gross domestic product (GDP) across countries.
// It tells how many dollars are needed to buy a dollar's worth of goods in the country as compared to the United States.
// PPP conversion factors are based on the 2011 ICP round.
//
// SourceWorld Bank, International Comparison Program database."
//
// GDP per-capita - PPP int-$ adjusted (2015 current prices): "GDP per capita based on purchasing power parity (PPP).
// PPP GDP is gross domestic product converted to international dollars using purchasing power parity rates.
// An international dollar has the same purchasing power over GDP as the U.S.
// dollar has in the United States.
// GDP at purchaser's prices is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products.
// It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources.
// Data are in current international dollars based on the 2011 ICP round.
//
// SourceWorld Bank, International Comparison Program database."
//
// GDP per-capita - US $ market exchange (2015 current prices): "GDP per capita is gross domestic product divided by midyear population.
// GDP is the sum of gross value added by all resident producers in the economy plus any product taxes and minus any subsidies not included in the value of the products.
// It is calculated without making deductions for depreciation of fabricated assets or for depletion and degradation of natural resources.
// Data are in current U.S.
// dollars.
//
// SourceWorld Bank national accounts data, and OECD National Accounts data files."
//
// Country names were modified according to OWID standardized country names.
type IndicatorsForWhatIsPppWorldBankDataset struct {
	PriceLevelRatioOfPppConversionFactorGdpToMarketExchangeRateWorldBank *float64 `json:"price_level_ratio_of_ppp_conversion_factor_gdp_to_market_exchange_rate_world_bank"`
	GdpPerCapitaPppIntMoneyAdjustedWorldBank                             *float64 `json:"gdp_per_capita_ppp_int_money_adjusted_world_bank"`
	GdpPerCapitaUsMoneyMarketExchangeWorldBank                           *float64 `json:"gdp_per_capita_us_money_market_exchange_world_bank"`
}

