// DNA Sequencing Costs: Data from the NHGRI Genome Sequencing Program (GSP) Available at: www.genome.gov/sequencingcostsdata [accessed 2017-07-11].The NHGRI program describe genome sequencing costs relative to two metrics, quoted below:"(1) "Cost per Megabase of DNA Sequence" - the cost of determining one megabase (Mb; a million bases) of DNA sequence of a specified quality;(2) "Cost per Genome" - the cost of sequencing a human-sized genome."Cost data from the NHGRI is presented either biannually or seasonally for each year.
// Here, we have summarized this data on an annual basis by calculating the yearly average cost.The number of DNA base pairs sequenced per US$ was calculated by dividing 1 by the metric, "Cost per Megabase of DNA Sequence", and multiplying by 1 million.
