// Jambeck et al.
// quantified municipal and plastic waste streams from coastal populations in 2010 with projections to the year 2025.The authors' definition of a coastal population is based on those who live within 50km of a coastal water.
// Such populations are those for which plastic waste is at risk of leading to ocean debris.
// Sources further inland are significantly less likely to end up as ocean debris.The authors define mismanaged and inadequately managed waste as follows: "mismanaged waste is material that is either littered or inadequately disposed.
// Inadequately disposed waste is not formally managed and includes disposal in dumps or open, uncontrolled landfills, where it is not fully contained.
// Mismanaged waste could eventually enter the ocean via inland waterways,wastewater outflows, and transport by wind or tides."In October 2019, per capita plastic waste figures for Trinidad and Tobago were updated from 3.6kg to 0.29kg per person per day.
