// Both are based on the notion of an average individual in the reference population.This is the traditional FAO hunger indicator, adopted as official Millennium Development Goal indicator for Goal 1, Target 1.9.The indicator is calculated in three year averages, from 1969-71 to 2014-16 to reduce the impact of possible errors in estimated DES, due to the difficulties in properly accounting of stock variations in major food.The FAO has maintained a constant definition of "developing countries" throughout the data series, with the following definition: "Includes all countries other than developed countries, namely: all countries in Africa except South Africa, all countries in Asia except Israel and Japan, all countries in Oceania except Australia and New Zealand, and all countries in North and Central America except Canada and USA, and all countries in South America."The aggregates are computed using a weighted population average.Earlier estimates for the prevalence of undernourishment in developing countries for 1970 and 1980.
// Over this period, methodological methods for the estimation of undernourishment have been refined for use in tracking progress on MDGs from 1990 onwards- this means earlier estimates have a higher level of uncertainty.
// Figures given here for 1970 and 1980 have been taken as the average between two FAO estimates from annual "State of Food Insecurity in the World" reports in 2006 and 2010 (referenced below).
// These estimates should therefore be utilised with caution, but have been included for longer-term perspective on reduction trends.References:FAO.
