// Teachers are marked as absent from school if during the second unannounced visit, they are not found anywhere on the school premises.
// Otherwise, they are marked as present.
// Teachers are marked as absent from class if during the second unannounced visit, they are absent from school or present at school but absent from the classroom.
// Otherwise, they are marked as present.
// The scheduled teaching time is the length of the school day minus break time.
// Time spent teaching adjusts the length of the school day by the share of teachers who are present in the classroom, on average, and the time the teacher spends teaching while in the classroom.
// The orphaned classrooms measure is the ratio of the classrooms with students but no teacher to the number of classrooms with students with or without a teacher.
// All individual country statistics are calculated using country-specific sampling weights.
// The average for all countries is taken by averaging over the country columns.
// Hence, each country is given equal weight.
// Further details on the construction of the variables and sampling weights are available in an Appendix available from the authors upon request.
type TeacherAbsenteeismBoldEtAl2017Dataset struct {
	PercentageOfTeachersAbsentFromClass  *float64 `json:"percentage_of_teachers_absent_from_class"`
	PercentageOfTeachersAbsentFromSchool *float64 `json:"percentage_of_teachers_absent_from_school"`
}

