// The Global Terrorism Database definitions can be found at (https://www.start.umd.edu/gtd/downloads/Codebook.pdf) and are as follows:A terrorist incident is included in GTD if it is the following:- The incident must be intentional – the result of a conscious calculation on the part of a perpetrator.- The incident must entail some level of violence or immediate threat of violence -including property violence, as well as violence against people.- The perpetrators of the incidents must be sub-national actors.
// The database does not include acts of state terrorism.In addition, at least two of the following three criteria must be present for an incident to be included in the GTD:- Criterion 1: The act must be aimed at attaining a political, economic, religious, or social goal.
// In terms of economic goals, the exclusive pursuit of profit does not satisfy this criterion.
// It must involve the pursuit of more profound, systemic economic change.- Criterion 2: There must be evidence of an intention to coerce, intimidate, or convey some other message to a larger audience (or audiences) than the immediate victims.
// It is the act taken as a totality that is considered, irrespective if every individual involved in carrying out the act was aware of this intention.
// As long as any of the planners or decision-makers behind the attack intended to coerce, intimidate or publicize, the intentionality criterion is met.- Criterion 3: The action must be outside the context of legitimate warfare activities.
// That is, the act must be outside the parameters permitted by international humanitarian law (particularly the prohibition against deliberately targeting civilians or non-combatants).Is it defined as a suicide attack?This variable is coded “Yes” in those cases where there is evidence that the perpetrator did not intend to escape from the attack alive.
// Successful vs.
// unsuccessful attacks:"The GTD does include attacks that were attempted but ultimately unsuccessful.
// The circumstances vary depending on tactics (for details see the success variable, below).
// However, in general if a bomb is planted but fails to detonate; if an arsonist is intercepted by authorities before igniting a fire; or, if an assassin attempts and fails to kill his or her intended target, the attack is considered for inclusion in the GTD, but denoted as unsuccessful.Success of a terrorist strike is defined according to the tangible effects of the attack.
// Success is not judged in terms of the larger goals of the perpetrators.
// For example, a bomb that exploded in a building would be counted as a success even if it did not succeed in bringing the building down or inducing government repression.
// The definition of a successful attack depends on the type of attack.
// Essentially, the key question is whether or not the attack type took place.
// If a case has multiple attack types, it is successful if any of the attack types are successful, with the exception of assassinations, which are only successful if the intended target is killed."Fatalities are defined as:"The number of total confirmed fatalities for the incident.
// The number includes all victims and attackers who died as a direct result of the incident.
// Where there is evidence of fatalities, but a figure is not reported or it is too vague to be of use, this field remains blank.
// If information is missing regarding the number of victims killed in an attack, but perpetrator fatalities are known, this value will reflect only the number of perpetrators who died as a result of the incident.
// Likewise, if information on the number of perpetrators killed in an attack is missing, but victim fatalities are known, this field will only report the number of victims killed in the incident."Injuries are:"the number of confirmed non-fatal injuries to both perpetrators and victims."
type TerrorismIncidentsFatalitiesAndInjuriesGlobalTerrorismDatabase2018Dataset struct {
	TerrorismFatalitiesGtd                                 *float64 `json:"terrorism_fatalities_gtd"`
	NumberOfTerroristIncidentsGdt2018                      *float64 `json:"number_of_terrorist_incidents_gdt_2018"`
	NumberOfSuccessfulTerroristIncidentsGdt2018            *float64 `json:"number_of_successful_terrorist_incidents_gdt_2018"`
	NumberOfUnsuccessfulTerroristIncidentsGdt2018          *float64 `json:"number_of_unsuccessful_terrorist_incidents_gdt_2018"`
	ShareOfTerroristIncidentsSuccessfulGdt2018             *float64 `json:"share_of_terrorist_incidents_successful_gdt_2018"`
	NumberOfSuicideTerroristIncidentsGdt2018               *float64 `json:"number_of_suicide_terrorist_incidents_gdt_2018"`
	NumberOfNonSuicideTerroristIncidentsGdt2018            *float64 `json:"number_of_non_suicide_terrorist_incidents_gdt_2018"`
	ShareOfTerroristIncidentsWithSuicideAttemptGdt2018     *float64 `json:"share_of_terrorist_incidents_with_suicide_attempt_gdt_2018"`
	NumberWoundedFromTerroristAttacksGdt2018               *float64 `json:"number_wounded_from_terrorist_attacks_gdt_2018"`
	NumberOfIncidentsWhichResultedInFatalityGdt2018        *float64 `json:"number_of_incidents_which_resulted_in_fatality_gdt_2018"`
	ShareOfTerroristIncidentsWithAtLeastOneFatalityGdt2018 *float64 `json:"share_of_terrorist_incidents_with_at_least_one_fatality_gdt_2018"`
	AverageFatalitiesPerIncidentGdt2018                    *float64 `json:"average_fatalities_per_incident_gdt_2018"`
}

// As explained by the Global Terrorism Database (https://www.start.umd.edu/gtd/downloads/Codebook.pdf):Data denotes the general type of target/victim.
// When a victim is attacked specifically because of his or her relationship to a particular person, such as a prominent figure, the target type reflects that motive.
// Forexample, if a family member of a government official is attacked because of his or her relationship to that individual, the type of target is “government.” This variable consists of the following 22 categories:1 = BUSINESSBusinesses are defined as individuals or organizations engaged in commercial or mercantile activity as a means of livelihood.
// Any attack on a business or private citizens patronizing a business such as a restaurant, gas station, music store, bar, café, etc.
// This includes attacks carried out against corporate offices or employees of firms like mining companies, or oil corporations.
// Furthermore, includes attacks conducted on business people or corporate officers.
// Included in this value as well are hospitals and chambers of commerce and cooperatives.
// Does not include attacks carried out in public or quasi-public areas such as “business district or commercial area”, or generic business-related individuals such as“businessmen” (these attacks are captured under “Private Citizens and Property”, see below.) Also does not include attacks against generic business-related individuals such as “businessmen.” Unless the victims were targeted because of their specific business affiliation, these attacks belong in “Private Citizens and Property.”2 = GOVERNMENT (GENERAL)Any attack on a government building; government member, former members, including members of political parties in official capacities, their convoys, or events sponsored by political parties; political movements; or a government sponsored institution where the attack is expressly carried out to harm the government.
// This value includes attacks on judges, public attorneys (e.g., prosecutors), courts and court systems, politicians, royalty, head of state, government employees (unless police or military), election-related attacks, or intelligence agencies and spies.
// This value does not include attacks on political candidates for office or members of political parties that do not hold an elected office (these attacks are captured in “Private Citizens and Property”).3 = POLICEThis value includes attacks on members of the police force or police installations; this includes police boxes, patrols headquarters, academies, cars, checkpoints, etc.
// Includes attacks against jails or prison facilities, or jail or prison staff or guards.4 = MILITARYIncludes attacks against military units, patrols, barracks, convoys, jeeps, and aircraft.
// Also includes attacks on recruiting sites, and soldiers engaged in internal policing functions such as at checkpoints and in anti narcotics activities.
// This category also includes peacekeeping units that conduct military operations (e.g., AMISOM).
// Excludes attacks against non-state militias and guerrillas, these types of attacks are coded as “Terrorist/Non-state Militias” see below.5 = ABORTION RELATEDAttacks on abortion clinics, employees, patrons, or security personnel stationed at clinics.6 = AIRPORTS & AIRCRAFTAn attack that was carried out either against an aircraft or against an airport.
// Attacks against airline employees while on board are also included in this value.
// Includes attacks conducted against airport business offices and executives.
// Military aircraft are not included.7 = GOVERNMENT (DIPLOMATIC)Attacks carried out against foreign missions, including embassies, consulates, etc.
// This value includes cultural centers that have diplomatic functions, and attacks against diplomatic staff and their families (when the relationship is relevant to the motive of the attack) and property.
// The United Nations is a diplomatic target.8 = EDUCATIONAL INSTITUTIONAttacks against schools, teachers, or guards protecting school sites.
// Includes attacks against university professors, teaching staff and school buses.
// Moreover, includes attacks against religious schools in this value.
// As noted below in the “Private Citizens and Property” value, the GTD has several attacks against students.
// If attacks involving students are not expressly against a school, university or other educational institution or are carried out in an educational setting, they are coded as private citizens and property.
// Excludes attacks against military schools (attacks on military schools are coded as “Military,” see below).9 = FOOD OR WATER SUPPLYAttacks on food or water supplies or reserves are included in this value.
// This generally includes attacks aimed at the infrastructure related to food and water for human consumption.10 = JOURNALISTS & MEDIAIncludes, attacks on reporters, news assistants, photographers, publishers, as well as attacks on media headquarters and offices.
// Attacks on transmission facilities such as antennae or transmission towers, or broadcast infrastructure are coded as “Telecommunications,” see below.11 = MARITIME (INCLUDES PORTS AND MARITIME FACILITIES)Includes civilian maritime: attacks against fishing ships, oil tankers, ferries, yachts, etc.
// (Attacks on fishermen are coded as “Private Citizens and Property,” see below).12 = NGOIncludes attacks on offices and employees of non-governmental organizations (NGOs).
// NGOs here include large multinational non-governmental organizations such as the Red Cross and Doctors without Borders, as well as domestic organizations.13= OTHERThis value includes acts of terrorism committed against targets which do not fit into other categories.
// Some examples include ambulances, firefighters, and international demilitarized zones.14= PRIVATE CITIZENS & PROPERTYThis value includes attacks on individuals, the public in general or attacks in public areas including markets, commercial streets, busy intersections and pedestrian malls.
// Also includes ambiguous cases where the target/victim was a named individual, or where the target/victim of an attack could be identified by name, age, occupation, gender or nationality.
// This value also includes ceremonial events, such as weddings and funerals.
// The GTD contains a number of attacks against students.
// If these attacks are not expressly against a school, university or other educational institution or are not carried out in an educational setting, these attacks are coded using this value.
// Also, includes incidents involving political supporters as private citizens and property, provided that these supporters are not part of a government-sponsored event.
// Finally, this value includes police informers.
// Does not include attacks causing civilian casualties in businesses such as restaurants, cafes or movie theaters (these categories are coded as “Business” see above).15 = RELIGIOUS FIGURES/INSTITUTIONSThis value includes attacks on religious leaders, (Imams, priests, bishops, etc.), religious institutions (mosques, churches), religious places or objects (shrines, relics, etc.).
// This value also includes attacks on organizations that are affiliated with religious entities that are not NGOs, businesses or schools.
// Attacks on religious pilgrims are considered “Private Citizens and Property;” attacks on missionaries are considered religious figures.16 = TELECOMMUNICATIONThis includes attacks on facilities and infrastructure for the transmission of information.
// More specifically this value includes things like cell phone towers, telephone booths, television transmitters, radio, and microwave towers.17 = TERRORISTS/NON-STATE MILITIASTerrorists or members of identified terrorist groups within the GTD are included in this value.
// Membership is broadly defined and includes informants for terrorist groups, but excludes former or surrendered terrorists.This value also includes cases involving the targeting of militias and guerillas.18 = TOURISTSThis value includes the targeting of tour buses, tourists, or “tours.” Tourists are persons who travel primarily for the purposes of leisure or amusement.
// Government tourist offices are included in this value.
// The attack must clearly target tourists, not just an assault on a business or transportation system used by tourists.
// Travel agencies are coded as business targets.19 = TRANSPORTATION (OTHER THAN AVIATION)Attacks on public transportation systems are included in this value.
// This can include efforts to assault public buses, minibuses, trains, metro/subways, highways (if the highway itself is the target of the attack), bridges, roads, etc.
// The GTD contains a number of attacks on generic terms such as “cars” or “vehicles.” These attacks are assumed to be against “Private Citizens and Property” unless shown to be against public transportation systems.
// In this regard, buses are assumed to be public transportation unless otherwise noted.20 = UNKNOWNThe target type cannot be determined from the available information.21 = UTILITIESThis value pertains to facilities for the transmission or generation of energy.
// For example, power lines, oil pipelines, electrical transformers, high tension lines, gas and electric substations, are all included in this value.
// This value also includes lampposts or street lights.
// Attacks on officers, employees or facilities of utility companies excluding the type of facilities above are coded as business.22 = VIOLENT POLITICAL PARTIESThis value pertains to entities that are both political parties (and thus, coded as “government” in this coding scheme) and terrorists.
// It is operationally defined as groups that engage in electoral politics and appear as “Perpetrators” in the GTD.
type TerroristAttackByTargetTypeGlobalTerrorismDatabase2018Dataset struct {
	AbortionRelated              *float64 `json:"abortion_related"`
	AirportsAndAircraft          *float64 `json:"airports_and_aircraft"`
	Business                     *float64 `json:"business"`
	EducationalInstitution       *float64 `json:"educational_institution"`
	FoodOrWaterSupply            *float64 `json:"food_or_water_supply"`
	GovernmentDiplomatic         *float64 `json:"government_diplomatic"`
	GovernmentGeneral            *float64 `json:"government_general"`
	JournalistsAndMedia          *float64 `json:"journalists_and_media"`
	Maritime                     *float64 `json:"maritime"`
	Military                     *float64 `json:"military"`
	Ngo                          *float64 `json:"ngo"`
	Other                        *float64 `json:"other"`
	Police                       *float64 `json:"police"`
	PrivateCitizensAndProperty   *float64 `json:"private_citizens_and_property"`
	ReligiousFiguresinstitutions *float64 `json:"religious_figuresinstitutions"`
	Telecommunications           *float64 `json:"telecommunications"`
	TerroristsnonStateMilitia    *float64 `json:"terroristsnon_state_militia"`
	Tourists                     *float64 `json:"tourists"`
	Transportation               *float64 `json:"transportation"`
	Unknown                      *float64 `json:"unknown"`
	Utilities                    *float64 `json:"utilities"`
	ViolentPoliticalParty        *float64 `json:"violent_political_party"`
}

// This metric captures the general method of a terrorist attack and often reflects the broad class of tactics used.
// It consists of nine categories, which are defined below.1 = ASSASSINATIONAn act whose primary objective is to kill one or more specific, prominent individuals.
// Usually carried out on persons of some note, such as highranking military officers, government officials, celebrities, etc.
// Not to include attacks on non-specific members of a targeted group.
// The killing of a police officer would be an armed assault unless there is reason to believe the attackers singled out a particularly prominent officer for assassination.2 = ARMED ASSAULTAn attack whose primary objective is to cause physical harm or death directly to human beings by use of a firearm, incendiary, or sharp instrument (knife, etc.).
// Not to include attacks involving the use of fists, rocks, sticks, or other handheld (less-than-lethal) weapons.
// Also includes attacks involving certain classes of explosive devices in addition to firearms, incendiaries, or sharp instruments.
// The explosive device subcategories that are included in this classification are grenades, projectiles, and unknown or other explosive devices that are thrown.3 = BOMBING/EXPLOSIONAn attack where the primary effects are caused by an energetically unstable material undergoing rapid decomposition and releasing a pressure wave that causes physical damage to the surrounding environment.
// Can include either high or low explosives (including a dirty bomb) but does not include a nuclear explosive device that releases energy from fission and/or fusion, or an incendiary device where decomposition takes place at a much slower rate.
// If an attack involves certain classes of explosive devices along with firearms, incendiaries, or sharp objects, then the attack is coded as an armed assault only.
// The explosive device subcategories that are included in this classification are grenades, projectiles, and unknown or other explosive devices that are thrown in which the bombers are also using firearms or incendiary devices.4 = HIJACKINGAn act whose primary objective is to take control of a vehicle such as an aircraft, boat, bus, etc.
// for the purpose of diverting it to an unprogrammed  destination, force the release of prisoners, or some other political objective.
// Obtaining payment of a ransom should not the sole purpose of a Hijacking, but can be one element of the incident so long as additional objectives have also been stated.
// Hijackings are distinct from Hostage Taking because the target is a vehicle, regardless of whether there are people/passengers in the vehicle.5 = HOSTAGE TAKING (BARRICADE INCIDENT)An act whose primary objective is to take control of hostages for the purpose of achieving a political objective through concessions or through disruption of normal operations.
// Such attacks are distinguished from kidnapping since the incident occurs and usually plays out at the target location with little or no intention to hold the hostages for an extended period in a separate clandestine location.6 = HOSTAGE TAKING (KIDNAPPING)An act whose primary objective is to take control of hostages for the purpose of achieving a political objective through concessions or through disruption of normal operations.
// Kidnappings are distinguished from Barricade Incidents (above) in that they involve moving and holding the hostages in another location.7 = FACILITY / INFRASTRUCTURE ATTACKAn act, excluding the use of an explosive, whose primary objective is to cause damage to a non-human target, such as a building, monument, train, pipeline, etc.
// Such attacks include arson and various forms of sabotage (e.g., sabotaging a train track is a facility/infrastructure attack, even if passengers are killed).
// Facility/infrastructure attacks can include acts which aim to harm an installation, yet also cause harm to people incidentally (e.g.
// an arson attack primarily aimed at damaging a building, but causes injuries or fatalities).8 = UNARMED ASSAULTAn attack whose primary objective is to cause physical harm or death directly to human beings by any means other than explosive, firearm, incendiary, or sharp instrument (knife, etc.).
// Attacks involving chemical, biological or radiological weapons are considered unarmed assaults.9 = UNKNOWNThe attack type cannot be determined from the available information.
type TerroristAttacksByTypeGlobalTerrorismDatabase2018Dataset struct {
	Assassination                  *float64 `json:"assassination"`
	HostageTakingKidnapping        *float64 `json:"hostage_taking_kidnapping"`
	Bombingexplosion               *float64 `json:"bombingexplosion"`
	FacilityinfrastructureAttack   *float64 `json:"facilityinfrastructure_attack"`
	ArmedAssault                   *float64 `json:"armed_assault"`
	Hijacking                      *float64 `json:"hijacking"`
	Unknown                        *float64 `json:"unknown"`
	HostageTakingBarricadeIncident *float64 `json:"hostage_taking_barricade_incident"`
	UnarmedAssault                 *float64 `json:"unarmed_assault"`
}

// The general weapon used in a given terrorist attack is recorded in the following categories:1 = BiologicalA weapon whose components are produced from pathogenic microorganisms or toxic substances of biological origins.2 = ChemicalA weapon produced from toxic chemicals that is contained in a delivery system and dispersed as a liquid, vapor, or aerosol.
// This category includes chemical weapons delivered via explosive device.3 = RadiologicalA weapon whose components are produced from radioactive materials that emit ionizing radiation and can take many forms.4 = NuclearA weapon which draws its explosive force from fission, fusion, or a combination of these methods.5 = FirearmsA weapon which is capable of firing a projectile using an explosive charge as a propellant.6 = ExplosivesA weapon composed of energetically unstable material undergoing rapid decomposition and releasing a pressure wave that causes physical damage to the surrounding environment.
// Note that chemical weapons delivered via explosive are classified as “Chemical” with weapon subtype “Explosives.”7 = Fake WeaponsA weapon that was claimed by the perpetrator at the time of the incident to be real but was discovered after-the-fact to be non-existent or incapable of producing the desired effects.8 = IncendiaryA weapon that is capable of catching fire, causing fire, or burning readily and produces intensely hot fire when exploded.9 = MeleeA weapon—targeting people rather than property—that does not involve a projectile in which the user and target are in contact with it simultaneously.10 = VehicleAn automobile that is used in an incident that does not incorporate the use of explosives such as a car bomb or truck bomb.11 = Sabotage EquipmentA weapon that is used in the demolition or destruction of property (e.g., removing bolts from a train tracks).12 = OtherA weapon that has been identified but does not fit into one of the above categories.13 = UnknownThe weapon type cannot be determined from the available information.
