// Data on time-use may be summarized and presented as either (1) average time spent for participants only or (2) average time spent for all population of certain age.
// In the former type of averages the total time spent by the individuals who performed an activity is divided by the number of persons who performed it (participants).
// In the latter type of averages the total time is divided by the total relevant population (or a sub-group thereof) regardless of whether people performed the activity or not.
// All statistics presented in the Minimum Set on Gender Indicators on time spent in various activities are averages based on all total relevant population.
// This type of averages can be used to compare groups and assess changes over time.
// Differences among groups or over time may be due to a difference (or change) in the proportion of those participating in the specific activity or a difference (or change) in the amount of time spent by participants or both.
// Data presented for this indicator are expressed as an average per day.
// It is averaged over seven days of the week (weekdays and weekends are not differentiated)."
type TimeSpentOnDomesticWorkUn2017AndOecd2014Dataset struct {
	DailyTimeSpentOnDomesticWorkWomenUn2017 *float64 `json:"daily_time_spent_on_domestic_work_women_un_2017"`
}

