// Data on literacy rates come from a variety of sources (such as national censuses and surveys) and reporting modes (self-reporting vs household declarations).
//
//
// Data instruments used to estimate literacy are grouped under three main types: i) a census; ii) a survey; or iii) indirect estimates.
// Indirect estimates are extrapolated - based on educational attainment, or estimated based on the country's census.
