// Methodologies used for measuring literacy have been grouped into four categories: household declarations, self declarations, literacy tests, and national estimates.
// Both household and self-declared literacy are self-reports; in the former, it is the head of the household responding to the survey, and in the latter it is directly reported by the individuals themselves.
