// Data was assessed by Our World in Data based on UN documentation of its Urbanization Prospects (2018).
// The Urbanization Prospects presents data on the number and share of the population residing in urban areas for each country from 1950 with projections to 2050.There is no consistent definition of what constitutes an 'urban area'.
// This is highly variable across countries.
// This data presents a given country's minimum threshold of inhabitants needed for it to be defined an 'urban area'.
// For many countries, there is no defined threshold based on inhabitants; other metrics such as population density, infrastructure, or even pre-defined cities may be used.Note that some countries with minimum inhabitant thresholds noted here also include additional qualities (such as population density) to be met.
type UrbanDefinitionPopulationThresholdUn2018Dataset struct {
	MinimumPopulationThresholdForUrbanAreaUn2018 *float64 `json:"minimum_population_threshold_for_urban_area_un_2018"`
}

// Data on the total size of urban populations living in slums was calculated by Our World in Data based on metrics published within the World Bank, World Development Indicators: 'Urban population (total)' and '% urban population living in slums'.Population living in slums is the proportion of the urban population living in slum households.
// A slum household is defined as a group of individuals living under the same roof lacking one or more of the following conditions: access to improved water, access to improved sanitation, sufficient living area, and durability of housing.
type UrbanPopulationLivingInSlumsWbWdiDataset struct {
	UrbanPopulationLivingInSlums    *float64 `json:"urban_population_living_in_slums"`
	UrbanPopulationNotLivingInSlums *float64 `json:"urban_population_not_living_in_slums"`
}

// To construct the long run urbanization series we began with the UN World Urbanization Prospects database covering the period from 1950 to 2050.
// Then we extended the series backwards using additional data sources including the US Census Bureau, Bairoch (1988), Kuroda (1984), HYDE 3.1 (2010), and De Vries (1984) to arrive at the longest single series possible for each country and region included.
// For further information on the source used for particular observations by country-year, see the following <a href="https://docs.google.com/spreadsheets/d/1tl3FmKTD_FaQ-i4VUlusS-OcZHOl30zkK7oIsuQPtJ4/edit?usp=sharing" rel="noopener" target="_blank">documentation</a>.
// To calculate the absolute rural and urban populations, we have multiplied the rural and urban percentages by the historic population series published by Gapminder until 1949 and extended using the UN Population Division data from 1950 to 2016.
// The long run 'Gapminder + UN Population' population series is available <a href="https://ourworldindata.org/grapher/population-by-country-gapminder+un" rel="noopener" target="_blank">here</a>.
//  For absolute population estimates before 1950 for the 'World', we used the <a href="https://ourworldindata.org/grapher/world-population-1750-2015-and-un-projection-until-2100" rel="noopener" target="_blank">'World Population over 12,000 years' series</a>.Note: Urbanization data for Japan in 1900 has been excluded as the estimate (HYDE 3.1) was inconsistent with figures for neighbouring years (Kuroda (1986)).
