// The data on political regimes is taken from the Polity IV dataset and I have added the information on colonial regimes based on Wimmer and Min.Wimmer and Min (2006) – “From empire to nation-state: Explaining war in the modern world, 1816-2001”, American Sociological Review 71(6):867-897, 2006.Countries receiving Polity scores of -10 to 5 are classified as autocracies, scores of -5 to 0 as closed anocracies, scores of 1-5 as open anocracies, 6 to 10 are classified as democracies.Three changes have been made to the Polity IV measures:*For the period 1937 to 1945 I interpolated for China with -5 (the score in the year before and after).
// This is the time of the Second Sino-Japanese War (1937–45).
// * For the years 1861 and 1860 China has no data in Polity IV.
// Here the score -6 which is the score in the period before and after is assigned.
// 1861 is the year of the Battle of Shanghai during the Taiping Rebellion.
// * For India the Polity IV has no data for 1947, 1948, and 1949 – the time of the "Partition of India".
// For the period after the Polity IV score is 9; here this score is used from 1947 (the year of independence from Britain).The data on the countries’ population is taken from Gapminder and for the total world population from Our World In Data.
// The difference between the total of number of people for which information on the country regime was available and the total world population is reported as "Country in tranistion or no data".
// Population by country data comes from the following sources:* Before 1950: From Gapminder.org* 1950-2015: UN Population Division (2015 Revision)* 2016 onwards: Medium Variant – UN Population Division (2015 Revision)
type WorldPopulationByPoliticalRegimeTheyLiveInOwid2016Dataset struct {
	CountryInTransitionOrNoDataOwid2016 *float64 `json:"country_in_transition_or_no_data_owid_2016"`
	PopulationInColonyOwid2016          *float64 `json:"population_in_colony_owid_2016"`
	PopulationInAutocracyOwid2016       *float64 `json:"population_in_autocracy_owid_2016"`
	PopulationInClosedAnocracyOwid2016  *float64 `json:"population_in_closed_anocracy_owid_2016"`
	PopulationInOpenAnocracyOwid2016    *float64 `json:"population_in_open_anocracy_owid_2016"`
	PopulationInDemocracyOwid2016       *float64 `json:"population_in_democracy_owid_2016"`
}

